import React from 'react'

const Laps = (props) => {
    return(
        <ul className="list-item list-item-flush">
            { props.laps.map(laps => {
                return(
                    <li className="list-group-item">
                        { laps.time.min }
                    </li>
                )
            })}
        </ul>
    )
}
export default Laps
